const canvas=d3.select("body").append("canvas").classed("full-page-canvas",true);const context=canvas.node().getContext("2d");function gridData(){var f=new Array();var b=1;var h=1;var d=$(window).width();var a=$(window).height();var e=0;for(var g=0;g<10;g++){f.push(new Array());for(var c=0;c<10;c++){f[g].push({x:b,y:h,width:d,height:a,click:e});b+=d}b=1;h+=a}return f};